export default function Landing() {

  return (
    <Page>
        <Hero>
            <div className="landing-blob">
              {<Blob/>}
            </div>
            <div className="landing-title">
            <h1>hi, i'm axel.</h1>
            <p>i'm at the crossroads between</p>
            <h3>UX/UI design,<br/>front-end development,<br/>graphic design,<br/>& branding.</h3>
            </div>
        </Hero>
        <PreviewSection title="About me." linkText="Read more">
